const STATEPROPS = {
  TEXT_CHANGING: "TEXT_CHANGING",
};

const DELIVERY_STATE = {
  city: "",
  address: "",
  deliveryData: "",
};

const delivery_reduser = (state, action) => {
  switch (action.type) {
    case STATEPROPS.TEXT_CHANGING: {
      return {
        ...state,
        [action.devinformation.name]: action.devinformation.value,
      };
    }
    default:
      return state;
  }
};
